PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE "schema_migrations" ("version" varchar NOT NULL);
CREATE TABLE "articles" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "price" float, "location" varchar, "sq_mts_t" float, "sq_mts_c" float, "baths" float, "lvls" integer, "parks" integer, "desc" text, "addr" text, "visits" integer, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "user_id" integer, "pic_file_name" varchar, "pic_content_type" varchar, "pic_file_size" integer, "pic_updated_at" datetime, "latitude" float, "longitude" float, "image" varchar);
CREATE TABLE "users" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "email" varchar DEFAULT '' NOT NULL, "encrypted_password" varchar DEFAULT '' NOT NULL, "reset_password_token" varchar, "reset_password_sent_at" datetime, "remember_created_at" datetime, "sign_in_count" integer DEFAULT 0 NOT NULL, "current_sign_in_at" datetime, "last_sign_in_at" datetime, "current_sign_in_ip" varchar, "last_sign_in_ip" varchar, "name" varchar, "permission_lvl" integer, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE "images" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "article_id" integer, "user_id" integer, "dir" varchar, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "height" integer, "width" integer);
DELETE FROM sqlite_sequence;
CREATE UNIQUE INDEX "unique_schema_migrations" ON "schema_migrations" ("version");
CREATE UNIQUE INDEX "index_users_on_email" ON "users" ("email");
CREATE UNIQUE INDEX "index_users_on_reset_password_token" ON "users" ("reset_password_token");
CREATE INDEX "index_articles_on_user_id" ON "articles" ("user_id");
CREATE INDEX "index_images_on_user_id" ON "images" ("user_id");
CREATE INDEX "index_images_on_article_id" ON "images" ("article_id");
COMMIT;
